tables.table_schema:
CREATE TABLE video_performance_reports (
  report_id INT PRIMARY KEY,
  video_id INT,
  performance_metric VARCHAR(50),
  performance_value FLOAT
);

CREATE TABLE videos (
  video_id INT PRIMARY KEY,
  title VARCHAR(100),
  category VARCHAR(50),
  duration INT
);

CREATE TABLE viewers (
  viewer_id INT PRIMARY KEY,
  name VARCHAR(100),
  age INT,
  location VARCHAR(50)
);

CREATE TABLE engagement_metrics (
  metric_id INT PRIMARY KEY,
  video_id INT,
  viewer_id INT,
  engagement_level VARCHAR(50)
);

CREATE TABLE marketing_strategies (
  strategy_id INT PRIMARY KEY,
  strategy_name VARCHAR(100),
  description TEXT,
  budget FLOAT
);
